import React, { useState, useEffect } from "react";
import "./App.scss";
import { Parser } from "html-to-react";
var x = require("./FS_NEDOPLATKY_FORM0001.html");
function App() {
	const [rawHTML, setRawHTML] = useState("");
	useEffect(() => {
		fetch("./FS_NEDOPLATKY_FORM0001.html")
			.then(function (response) {
				return response.text();
			})
			.then(function (string) {
				console.log(string);
			})
			.catch(function (err) {
				console.log("Fetch Error", err);
			});
	}, []);

	return <div style={container}>{Parser().parse(rawHTML)}</div>;
}

const container = {
	width: 800,
	margin: "auto",
};

export default App;
